// 상단바용 공용 UI
import React from 'react';
import { Link } from 'react-router-dom';
import './css/NavBar.css';

function NavBar(){
    return (
        <>
                <h1 to="/" className="navbar-title-class"> InstaClone </h1>
                <nav className="navigation-class">
                <Link to="/" className='navigation-button-class'>홈</Link>
                <Link to="/about" className='navigation-button-class'>탐색</Link>
                <Link to="/contact" className='navigation-button-class'>만들기</Link>
                </nav>
        </>
      );
}

export default NavBar;
